import React, { useState } from "react";
import {
  TextField,
  Button,
  Select,
  MenuItem,
  InputLabel,
  FormControl,
  FormLabel,
  RadioGroup,
  FormControlLabel,
  Radio,
  TextareaAutosize,
} from "@mui/material";
import {styled} from "@mui/system"
import { useLocation, useNavigate } from "react-router-dom";

function Order() {
  const navigate = useNavigate();
  const location = useLocation();
  const [form, setForm] = useState({
    firstName: "",
    lastName: "",
    phoneNumber: "",
    email: "",
    zipcode: 0,
    pickUpDate: Date,
    pickupTime: Date,
    numberOfServings: 0,
    orderType: "",
    flavor: "",
    orderDetails: "",
    refPictures: "",
  });
  const orderTypes = [
    {
      id: 1,
      value: "Cupcakes",
    },
    {
      id: 2,
      value: "Cakes",
    },
    {
      id: 3,
      value: "Cakes & Cupcakes",
    },
  ];
  const flavors = [
    {
      id: 1,
      value: "Strawberry",
    },
    {
      id: 2,
      value: "Vanilla",
    },
    {
      id: 3,
      value: "Chocolate",
    },
    {
      id: 4,
      value: "Red Velvet",
    },
    {
      id: 5,
      value: "Carrot",
    },
    {
      id: 6,
      value: "Other (please list below in details)",
    },
  ];
  const blue = {
    100: '#DAECFF',
    200: '#b6daff',
    400: '#3399FF',
    500: '#007FFF',
    600: '#0072E5',
    900: '#003A75',
  };

  const grey = {
    50: '#F3F6F9',
    100: '#E5EAF2',
    200: '#DAE2ED',
    300: '#C7D0DD',
    400: '#B0B8C4',
    500: '#9DA8B7',
    600: '#6B7A90',
    700: '#434D5B',
    800: '#303740',
    900: '#1C2025',
  };

  const Textarea = styled(TextareaAutosize)(
    ({ theme }) => `
    box-sizing: border-box;
    width: 320px;
    font-family: 'IBM Plex Sans', sans-serif;
    font-size: 0.875rem;
    font-weight: 400;
    line-height: 1.5;
    padding: 8px 12px;
    border-radius: 8px;
    color: ${theme.palette.mode === 'dark' ? grey[300] : grey[900]};
    background: ${theme.palette.mode === 'dark' ? grey[900] : '#fff'};
    border: 1px solid ${theme.palette.mode === 'dark' ? grey[700] : grey[200]};
    box-shadow: 0px 2px 2px ${theme.palette.mode === 'dark' ? grey[900] : grey[50]};

    &:hover {
      border-color: ${blue[400]};
    }

    &:focus {
      border-color: ${blue[400]};
      box-shadow: 0 0 0 3px ${theme.palette.mode === 'dark' ? blue[600] : blue[200]};
    }

    // firefox
    &:focus-visible {
      outline: 0;
    }
  `,
  );
  return (
    <div className="py-7">
      <div className="bg-white w-2/4 h-[900px] rounded-md flex flex-row justify-around mr-auto ml-auto pl-12">
        <form
          style={{
            display: "flex",
            flexDirection: "column",
            maxWidth: "450px",
            margin: "auto",
            height: "100%",
            gap: "3rem",
          }}
        >
          <h1 className="text-2xl font-semibold py-3">Let's Get You Some Cake!</h1>
          <TextField
            label="First Name"
            type="text"
            variant="outlined"
            name="firstName"
            value={form.firstName}
          />
          <TextField
            label="Last Name"
            type="text"
            variant="outlined"
            name="lastName"
            value={form.lastName}
          />
          <TextField
            label="Pickup Date"
            type="date"
            variant="outlined"
            name="date"
            value={form.pickUpDate}
          />
          <TextField
            label="Pickup Time"
            type="time"
            variant="outlined"
            name="time"
            value={form.pickupTime}
          />
          <TextField
            label="Number of Servings"
            type="text"
            variant="outlined"
            name="servings"
            value={form.numberOfServings}
          />
          <FormControl fullWidth>
            <InputLabel>Order Type</InputLabel>
            <Select sx={{ width: "60%" }}>
              {orderTypes.map((item) => (
                <MenuItem key={item.id}>{item.value}</MenuItem>
              ))}
            </Select>
          </FormControl>
          <FormControl>
            <FormLabel>Flavor</FormLabel>
            <RadioGroup row>
             {flavors.map((item)=> (<FormControlLabel value={item.value} key={item.id} control={<Radio />} label={item.value} />))}
            </RadioGroup>
          </FormControl>
          <FormControl>
            <Textarea minRows={3} placeholder="Allergies, Cake Flavor, and etc." label="Order details"/>
          </FormControl>
          <div className="py-2">
            <Button variant="contained" sx={{ backgroundColor: "black" }}>
              Submit Order
            </Button>
          </div>
        </form>
      </div>
    </div>
  );
}

export default Order;
